		["AP_NumFOE"] = {
			["outline"] = "OUTLINE",
			["fontSize"] = 16,
			["xOffset"] = 75.9996337890625,
			["displayText"] = "%c",
			["customText"] = "function()\n    f_gen_time = f_gen_time or 0\n    local curASP = UnitPower('player',8)\n    local Predict_AP = 0\n    local Predict_non_fill = 0\n    local ca_mod = 1\n    local bota_mod = 1\n    local SpellCast = UnitCastingInfo('player')\n    local CA\n    local bota_spell = 'Blessing of Elune'\n    local BOTA = UnitBuff('player', aura_env.bota_spell, false, \"PLAYER\")\n    \n    local CA = select(4, GetTalentInfo(5, 2, 1)) -- says if Incarnation is selected or not\n    if CA then CA = aura_env.inc else CA = aura_env.ca end\n    \n    local BUFF = UnitBuff('player', CA, false, \"PLAYER\")\n    \n    if select(1,BOTA) == aura_env.bota_spell then\n        bota_mod = 1.4\n    end\n    if select(1,SpellCast) == aura_env.lunarStrike  then\n        Predict_AP = 10\n    elseif select(1,SpellCast) == aura_env.solarWrath then\n        Predict_AP = 6\n    elseif select(1,SpellCast) == aura_env.healingTouch then -- Touch of the Stars\n        if GetPvpTalentInfo(5,1,1) == true then\n            Predict_non_fill = 15\n        else\n            Predict_non_fill = 0\n        end\n    elseif select(1,SpellCast) == aura_env.newMoon then -- New Moon\n        Predict_non_fill = 10\n    elseif select(1,SpellCast) == aura_env.halfMoon then -- Half Moon\n        Predict_non_fill = 20\n    elseif select(1,SpellCast) == aura_env.fullMoon then -- Full Moon\n        Predict_non_fill = 40\n    end\n    \n    \n    if not BUFF == false then\n        ca_mod = 1.5\n        if not UnitCastingInfo('player') == false then -- casting spells\n            if select(7,UnitBuff('player', CA, false, \"PLAYER\"))-GetTime() < select(6,UnitCastingInfo('player'))/1000-GetTime() then -- if our buff expires \n                ca_mod = 1\n            end\n        end\n    end\n    \n    local E = abs(curASP)+Predict_non_fill+(Predict_AP*ca_mod*bota_mod)\n    \n    local f_gen = (6*ca_mod*bota_mod)\n    local Haste = (UnitSpellHaste('player')/100)\n    local f_casttime = (select(4,GetSpellInfo(aura_env.solarWrath)) or 0) * (1/1000)\n    \n    if f_casttime == 0 then f_casttime = (1.5*1+(Haste)) end\n    \n    f_gen_time = f_gen / f_casttime\n    \n    local consume = 6\n    if curASP / consume < 1 then \n        ticks = math.ceil(curASP/consume)\n    else\n        ticks = math.ceil(curASP / consume)\n    end\n    local partial = (curASP+6 - ticks*consume)\n    if SS_GEN == nil then\n        SS_GEN = 0\n    end\n    if FOE_partial == nil then\n        FOE_partial = 0\n    end\n    local tick_time = math.ceil(ticks) * (1-(1*FOE_partial))\n    local FOE = (curASP / (-1*(SS_GEN+f_gen_time-((2*consume*(1+Haste))))))\n    local rate = (0.5/(1+(UnitSpellHaste(\"player\")/100))) \n    \n    --return string.format(\"%.1f\",FOE-(6*FOE_partial))\n    -- print(string.format(\"%.2f\",(ticks*rate)-(rate-(FOE_partial*rate))))\n    \n    return string.format(\"%.2f\",(ticks*rate)-(rate-(FOE_partial*rate)))\n    \n    --return string.format(\"%.2f\",ticks*rate)\n    \n    --return (string.format(\"%.2f\",ticks+(partial*FOE_partial)))\n    \n    --return string.format(\"%.1f\",tick_time)\nend",
