				},
				["init"] = {
					["do_custom"] = true,
					["custom"] = "aura_env.duration = 0\naura_env.expirationTime = 0\naura_env.stacks = 0\n\naura_env.dW, aura_env.dH = WeakAuras.regions[aura_env.id].region:GetSize()\naura_env.scale = 1\n\naura_env.icon = 0\n\n\naura_env.dots = function()\n    -- MODE 0 is for TOTAL_DOTS.\n    -- MODE 1 is for expected Astral Power per 1 sec.\n    -- MODE 2 is for expected Astral Power per YOUR RATE (in seconds).\n    \n    \n    \n    local MODE = 0\n    -- you may change this to 0, 1, or 2.\n    \n    \n    if TOTAL_DOTS == nil then -- in case this global variable hasn't intitialized yet\n        TOTAL_DOTS = 0\n    end\n    \n    local proc = 0.10\n    local asp = 5\n    local Haste = UnitSpellHaste('player')/100 \n    local dots = (TOTAL_DOTS / (2/(1+Haste))) \n    local output = (dots * asp * proc)\n    if MODE == 0 then \n        return TOTAL_DOTS \n    end\n    if MODE == 1 then\n        return string.format(\"%.2f\",output)\n    end\n    if MODE == 2 then\n        \n        \n        \n        local RATE = 5\n        -- your own time (in seconds); ex. 5 = 5sec.\n        \n        \n        \n        return string.format(\"%.2f\",output*RATE)\n    end\n    return TOTAL_DOTS -- in case you set the MODE to something that isn't 0, 1, or 2.\nend\n\n\n",
				},
