				},
				["events"] = "COMBAT_LOG_EVENT_UNFILTERED",
				["custom"] = "function(event,time,type,_,sourceGUID,_,_,_,destGUID,destname,_,_,spellid,spellname,_,_,_,_,_,_,_,_,_,_,_,_)\n    local CurrentTime = GetTime();\n    \n    local TOTAL_MF = TOTAL_MF or 0\n    local TOTAL_SF = TOTAL_SF or 0\n    \n    WA_TRACKER = WA_TRACKER or {}\n    \n    TOTAL_DOTS = TOTAL_DOTS or 0\n    \n    local WA_DUMP = WA_DUMP or function(guid)\n        if WA_TRACKER[guid] then\n            if WA_TRACKER[guid].MF == 1 then\n                TOTAL_DOTS = TOTAL_DOTS - 1\n            end\n            if WA_TRACKER[guid].SF == 1 then\n                TOTAL_DOTS = TOTAL_DOTS - 1\n            end\n            WA_TRACKER[guid] = nil\n        end\n    end\n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" and sourceGUID == UnitGUID(\"player\") then\n        if type == \"SPELL_AURA_APPLIED\" or type == \"SPELL_PERIODIC_DAMAGE\" or type == \"SPELL_AURA_REFRESH\" then \n            if spellid == 164812 then    -- Moonfire applied or tick\n                if not WA_TRACKER[destGUID] or WA_TRACKER[destGUID] == nil then\n                    WA_TRACKER[destGUID] = {};\n                    WA_TRACKER[destGUID].MF = WA_TRACKER[destGUID].MF or 0\n                    WA_TRACKER[destGUID].SF = WA_TRACKER[destGUID].SF or 0\n                end    \n                WA_TRACKER[destGUID].MF = 1\n                WA_TRACKER[destGUID].LastUpdate = CurrentTime\n            end\n            if spellid == 164815 then    -- Sunfire applied or tick\n                if not WA_TRACKER[destGUID] or WA_TRACKER[destGUID] == nil then\n                    WA_TRACKER[destGUID] = {};\n                    WA_TRACKER[destGUID].MF = WA_TRACKER[destGUID].MF or 0\n                    WA_TRACKER[destGUID].SF = WA_TRACKER[destGUID].SF or 0\n                end\n                WA_TRACKER[destGUID].SF = 1\n                WA_TRACKER[destGUID].LastUpdate = CurrentTime\n            end\n        end\n        if (type == \"SPELL_AURA_REMOVED\" or type == \"SPELL_DISPEL\") then    -- auras removed or dispelled\n            if spellid == 164812 then -- Moonfire\n                if WA_TRACKER[destGUID] or WA_TRACKER[destGUID] ~= nil then\n                    WA_TRACKER[destGUID].MF = 0\n                    WA_TRACKER[destGUID].LastUpdate = CurrentTime\n                end\n            elseif spellid == 164815 then -- Sunfire // separate due to multiple dispel.\n                if WA_TRACKER[destGUID] or WA_TRACKER[destGUID] ~= nil then\n                    WA_TRACKER[destGUID].SF = 0\n                    WA_TRACKER[destGUID].LastUpdate = CurrentTime\n                end\n            end\n        end\n    end\n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" and (type == \"UNIT_DIED\" or type == \"UNIT_DESTROYED\" or type == \"SPELL_INSTAKILL\") then -- Unit Died, remove them from the target list.\n        WA_DUMP(destGUID);\n    end\n    \n    if UnitIsDeadOrGhost(\"player\") then -- We died, or, exited combat, go ahead and purge the list\n        for guid,count in pairs(WA_TRACKER) do \n            WA_DUMP(guid);\n        end  \n        WA_TRACKER = {}; -- clean the table; will repopulate shortly if DOTs still exists.\n        TOTAL_DOTS = 0\n    end\n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" and sourceGUID == UnitGUID(\"player\") then\n        for guid,count in pairs(WA_TRACKER) do\n            if (CurrentTime - WA_TRACKER[guid].LastUpdate) > (3) then\n                --If we haven't had any DOT action in 3sec, it means our DOTs expired (max: 28.6sec; 22 * 1.3)\n                WA_DUMP(guid);\n            end\n        end        \n        for i,v in pairs(WA_TRACKER) do\n            TOTAL_MF = TOTAL_MF + WA_TRACKER[i].MF\n            TOTAL_SF = TOTAL_SF + WA_TRACKER[i].SF\n            TOTAL_DOTS = TOTAL_MF + TOTAL_SF    \n        end\n        -- print(TOTAL_MF..\" : \"..TOTAL_SF..\" : \"..TOTAL_DOTS) -- TEST ONLY, DND\n    end\n    if TOTAL_DOTS == nil or TOTAL_DOTS < 0 then\n        TOTAL_DOTS = 0\n    end\n    return true\nend",
