			["customText"] = "function()\n    \n    \n    local enabled = true --set to true/false.\n    \n    \n    if enabled == false then\n        return nil\n    end\n    if aura_env.dur == 0 then\n        return nil\n    else\n        local dec = 0\n        if aura_env.dur <= aura_env.pan then\n            dec = 1\n        end\n        \n        local color = \"ffc000\"\n        local output = string.format(\"%.\"..dec..\"f\",aura_env.dur)\n        \n        if dec == 1 then\n            if aura_env.glowy == true then\n                ActionButton_ShowOverlayGlow(WeakAuras.regions[aura_env.id].region) \n            end\n            return(\"|cff\"..color..output..\"|r\")\n        else\n            ActionButton_HideOverlayGlow(WeakAuras.regions[aura_env.id].region)\n            return output\n        end\n    end\nend",
