			["customText"] = "-------------------------------------------------------------------------------------------------------------\n-- Spinalcrack did not write the below code -- All credit goes to the original unknown author -- Thank you --\n-------------------------------------------------------------------------------------------------------------\n\nfunction()\n    local boss_health = UnitHealth(\"boss1\")\n    local boss_time = GetTime()\n    local boss_text\n    local boss_oldhealth\n    local boss_TTD = \"Boss TTD: \"\n    \n    if boss_oldhealth ~= boss_health then\n        boss_oldhealth = boss_health\n        if boss_health == UnitHealthMax(\"boss1\") then -- THiS BLOCK IS GOOD\n            wa_Spinal_boss_health0, wa_Spinal_boss_time0, wa_Spinal_boss_mhealth, wa_Spinal_boss_mtime = nil\n            boss_text = \" - - \"\n            return boss_TTD..boss_text\n        end\n        \n        if not wa_Spinal_boss_health0 then -- GOOD\n            wa_Spinal_boss_health0, wa_Spinal_boss_time0 = boss_health, boss_time\n            wa_Spinal_boss_mhealth, wa_Spinal_boss_mtime = boss_health, boss_time\n            return\n        end\n        \n        wa_Spinal_boss_mhealth = (wa_Spinal_boss_mhealth + boss_health) * .5\n        wa_Spinal_boss_mtime = (wa_Spinal_boss_mtime + boss_time) * .5\n        \n        if wa_Spinal_boss_mhealth >= wa_Spinal_boss_health0 then\n            boss_text = \" - - \"\n            wa_Spinal_boss_health0, wa_Spinal_boss_time0, wa_Spinal_boss_mhealth, wa_Spinal_boss_mtime =nil\n        else\n            boss_time = boss_health * (wa_Spinal_boss_time0 - wa_Spinal_boss_mtime) / (wa_Spinal_boss_mhealth - wa_Spinal_boss_health0)\n            if (boss_time <= 60) then\n                boss_text = format(\"%0.2d\",boss_time)           \n            elseif (boss_time > 60) then\n                boss_text = format(\"%d:%0.2d\",boss_time / 60, boss_time % 60)\n            end\n            if global_wa_outputInfo == 1 and boss_time == global_maxSTM_secs then global_wa_STM_GO = 1 else global_wa_STM_GO = 0 end\n            return boss_TTD..boss_text\n        end\n    end\nend\n\n\n\n\n\n\n\n\n\n\n\n\n",
